import React, { Component } from "react";
import RegisterForm from "../components/Forms/RegisterForm";
import Button from "../components/Button/Button";
import Greeting from "../components/Greeting/Greeting";

import Parse from "parse/dist/parse.min.js";

async function saveNewPlayer() {
  const soccerPlayer = new Parse.Object("SoccerPlayer");
  soccerPlayer.set("playerName", "Lord Bendtner");
  soccerPlayer.set("birthYear", 1991);
  soccerPlayer.set("attributes", ["braggadocious", "danish", "meme lord"]);
  try {
    const result = await soccerPlayer.save();
    alert("New object created with objectId: " + result.id);
  } catch (error) {
    alert("Failed to create new object: " + error.message);
  }
}

saveNewPlayer();

export default function signup() {
  return (
    <div>
      <header>
        <div className="Little_Greeting">Welcome to Tripster!</div>
        <div className="Greeting_title">Sign up</div>
      </header>

      <div>
        <RegisterForm />
        <Button text="Start exploring" type="signup" onClick={saveNewUser} />
      </div>
    </div>
  );
}
